import React from 'react'
import Image from './Image'

const Table = () => {
    return (
        <div>
            <table>
                {Array.from({length: 10}).map((_, row) => {
                    <tr>
                        {Array.from({length: 10}).map((_, col) => {
                            var index = (10 * row) + (col + 1)
                            var src = 'map/' + index + '.jpg'
                            return (
                                <td><Image src={src} /></td>
                            )
                        })}
                    </tr>
                })}
            </table>
        </div>
    )
}

export default Table
